// src/components/Navbar.tsx
import React from 'react';
import { Link } from 'react-router-dom';

const Navbar: React.FC = () => {
  return (
    <nav className="bg-gray-800 p-4 fixed w-full z-10 top-0">
      <div className="container mx-auto flex justify-between items-center">
        <div className="text-white text-lg font-bold">
          <Link to="/">Project Management</Link>
        </div>
        <div>
          <Link to="/stories" className="text-gray-300 hover:text-white mx-2">Stories</Link>
          <Link to="/active" className="text-gray-300 hover:text-white mx-2">Active Project</Link>
          <Link to="/login" className="text-gray-300 hover:text-white mx-2">Login</Link>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
